apartment_description:
For at least 1 year, longer preferred.
No pets nor smokers.
In the center of Amsterdam, on the third floor luxuriously finished and stylishly furnished 3-room apartment with 2 balconies and a storage room on the ground floor. The apartment is completely renovated in 2020 with new bathroom, kitchen, floor etc.
Ground floor:
Entrance / hall with bells plateau and mailboxes and access to the storage room of approx. 4 m² that has directly access to the street so it is ideal for storing of 2 bikes. The storage is equipped with electricity and shelves. From the hall there is also access to the beautiful and well-maintained communal yard where you can enjoy the sun all day.
3rd floor:
The entrance of the apartment is located on the third floor with next to it the completely renewed meter cupboard. From the entrance there is direct access to the living room with open kitchen, bedroom, toilet, wardrobe and central heating room with ample storage for household appliances.
Spacious living room with access to the sunny balcony at the rear and a 2.5-seater sofa, 2 stools, dining table for at least 6 people and a TV cabinet with Sony Flatscreen TV.
The kitchen is luxurious and equipped with all comforts such as a Bora with extractor fan, wine cooler, combi-oven, dishwasher, refrigerator and a freezer with 3 drawers.
The master bedroom with a double bed of 1.60 meters wide is in open connection with the bathroom with large washbasin, bathtub, walk-in shower and towel heater. Around the corner from the bedroom is the toilet room.
Next to the bedroom is also the wardrobe room with washer, dryer, lots of closet space and access to the balcony at the front.
Location:
The apartment is lying on a prime location on the Oostenburgereiland surrounded by greenery, water and characteristic buildings such as the Oosterkerk. The location is surrounded by stores (Albert Heijn around the corner) and nice restaurants as Frank\'s Smokehouse restaurant, De Scheepskameel, Instock, De Biertuin, Bar Botanique, Hannekes Boom and Brouwerij \'t IJ. Within walking distance you can reach the Marineterrein, Oostenburgerpark, Dappermarkt, Javastraat, the Scheepvaartsmuseum and NEMO science museum.
Accessibility
The house is perfectly accessible by public transport (bus/tram). The apartment is located between Muiderpoort Station and Central Station and bus line 22 stops around the corner.
Details:
- Built in 1988, completely renovated in 2020;
- Stylishly furnished with luxurious materials;
- Fully equipped with underfloor heating;
- Fully double glazed;
- Living area 72 sqm (measurement report available);
- Two sunny balconies (east and west);
- Top location in Center on Oostenburgereiland;
- Separate storage room on the ground floor;
- Energy label B;
- Easily accessible by public transport;
- Price is 1800,- excluding utilities;
- No pets allowed;
- Smoking not allowed;
- Deposit is 3500,- and refundable.
-Registration with the city hall is compulsory.

Newly and completely renovated ground floor apartment of approx 200m2.
This high quality renovated house is fully equipped and meets all needs. Private entrance, three bedrooms with two bathrooms and a good garden. Extra deepened basement (about 2.40m high) with full light penetration.
The beautiful property is located on private land in a prime location in the city!
CLASSIFICATION:
Entrance hall, toilet and stairs to the basement. Through the double door access to the spacious living room. At the rear is the open kitchen with appliances and access to the garden of approx 33m2.
In the extra sunken basement with full light entry are 4 bedrooms, 2 bathrooms, a separate toilet and a spacious laundry room / storage.
ENVIRONMENT:
The apartment is located in a quiet street in Amsterdam Oud-Zuid. The P.C. Hooftstraat, Beethoven Street, Ferdinand Bolstraat and Albert Cuyp Market are within walking distance, as well as the Museumplein, the Concertgebouw and Vondelpark. This area is served by tram lines 3, 5, 12, 16 and 24.
DETAILS:
- Property is completely renovated in 2013;
- Private Ground;
- New Foundation;
- 2 Levels;
- The entire house has an oak floor;
- Garden located in the southwest of about 33m2;
- Fully equipped with double glazing;
When renting:
- Rent is 3500,- exclusive bills;
- Deposit required is 6000,- and refundable;
- Upholstered;
- Delivery in consultation;
